import { Link } from "react-router-dom"

export default function(){
    return(
        <nav>
           <ul>
                <li><Link to>Home</Link></li>
                <li>Login</li>
                <li>Register</li>
                <li>About</li>
           </ul>
        </nav>
    )
}
